import{_ as e,o as t,c as r,O as a}from"./chunks/framework.9482e208.js";const d=JSON.parse('{"title":"§ 63.2-1512 Immunity of person making report, etc., from liability.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/63.2-1512.md","filePath":"vacode/63.2-1512.md"}'),i={name:"vacode/63.2-1512.md"},o=a('<h1 id="§-63-2-1512-immunity-of-person-making-report-etc-from-liability" tabindex="-1">§ 63.2-1512 Immunity of person making report, etc., from liability. <a class="header-anchor" href="#§-63-2-1512-immunity-of-person-making-report-etc-from-liability" aria-label="Permalink to &quot;§ 63.2-1512 Immunity of person making report, etc., from liability.&quot;">​</a></h1><p>Any person making a report pursuant to § <a href="http://law.lis.virginia.gov/vacode/63.2-1509/" target="_blank" rel="noreferrer">63.2-1509</a>, a complaint pursuant to § <a href="http://law.lis.virginia.gov/vacode/63.2-1510/" target="_blank" rel="noreferrer">63.2-1510</a>, or who takes a child into custody pursuant to § <a href="http://law.lis.virginia.gov/vacode/63.2-1517/" target="_blank" rel="noreferrer">63.2-1517</a>, or who participates in a judicial proceeding resulting therefrom shall be immune from any civil or criminal liability in connection therewith, unless it is proven that such person acted in bad faith or with malicious intent.</p><p>1975, c. 341, § 63.1-248.5; 1988, c. 686; 2002, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?021+ful+CHAP0747" target="_blank" rel="noreferrer">747</a>.</p>',3),n=[o];function l(c,s,p,m,_,f){return t(),r("div",null,n)}const u=e(i,[["render",l]]);export{d as __pageData,u as default};
